import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    button: {
      paddingVertical: 20,
      borderWidth: 1,
      borderColor: '#ccc',
      marginTop: 10,
  },
  textButton: {
      textAlign: 'center',
  },

  });

export default styles
